import React from "react";

function Nav({ setActiveSection }) {
  return (
    <div id="nav-buttons">
      <div id="prof-button">
        <button onClick={() => setActiveSection("professional")}>
          PROFESSIONAL
        </button>
      </div>
      <div id="pers-button">
        <button onClick={() => setActiveSection("personal")}>PERSONAL</button>
      </div>
    </div>
  );
}

export default Nav;
